css:
body {
	font-size: 16pt;
	color: black;
	font-family: Ubuntu-R;
}

p {
	padding: 0;
	margin: 0;
	font-size: 16pt;
	line-height: 24pt;
}

.stamper {
	width: 100%;
	height: 100%;
	font-size: 16pt;
	color: black;
	font-family: Ubuntu-B;
}

.para {
	color: red;
	padding: 0;
	margin: 0;
}

.fixed-width-text {
	font-family: courier;
}

.full-page {
	width: 515pt;
	height: 762pt;
}

.full-page-cell {
	border: 1pt solid green;
}

.stamper-header{
	padding-top: 0.5cm;
	padding-left: 0.5cm;
	padding-right: 0.5cm;
}

.stamper-footer{
	padding-bottom: 0.5cm;
	padding-left: 0.5cm;
	padding-right: 0.5cm;
}
